/*Data for the table `catissue_audit_event_query_log` */

insert into `catissue_audit_event_query_log` (`IDENTIFIER`,`QUERY_DETAILS`,`AUDIT_EVENT_ID`) values (1,'Select Site1.NAME  Column0 , Site1.IDENTIFIER  Column1 , Site1.TYPE  Column2 , Site1.EMAIL_ADDRESS  Column3 , Address1.STREET  Column4 , Address1.CITY  Column5 , Address1.STATE  Column6 , Address1.COUNTRY  Column7 , Address1.ZIPCODE  Column8 , Address1.PHONE_NUMBER  Column9 , Address1.FAX_NUMBER  Column10 \nFROM  CATISSUE_ADDRESS Address1 , CATISSUE_SITE Site1  \nWHERE Address1.IDENTIFIER   =  Site1.ADDRESS_ID    AND ( ( Site1.IDENTIFIER  IS NOT NULL  )   AND UPPER(Site1.ACTIVITY_STATUS ) != UPPER(\'Disabled\')  )\nORDER BY Site1.IDENTIFIER ,Address1.IDENTIFIER ',11),(2,'Select ContainerType1.NAME  Column0 , StorageType1.IDENTIFIER  Column1 , StorageType1.DEFAULT_TEMPERATURE  Column2 , ContainerType1.ONE_DIMENSION_LABEL  Column3 , ContainerType1.TWO_DIMENSION_LABEL  Column4 \nFROM  CATISSUE_STORAGE_TYPE StorageType1 , CATISSUE_CONTAINER_TYPE ContainerType1  \nWHERE StorageType1.IDENTIFIER   =  ContainerType1.IDENTIFIER    AND ( ( StorageType1.IDENTIFIER  IS NOT NULL  )   AND UPPER(ContainerType1.ACTIVITY_STATUS ) != UPPER(\'Disabled\')   AND UPPER(ContainerType1.ACTIVITY_STATUS ) != UPPER(\'Disabled\')  )\nORDER BY StorageType1.IDENTIFIER ,ContainerType1.IDENTIFIER ',12),(3,'Select Container1.NAME  Column0 , StorageContainer1.IDENTIFIER  Column1 , StorageContainer1.TEMPERATURE  Column2 , Site1.NAME  Column3 , Container1.FULL  Column4 , Container1.BARCODE  Column5 , Container1.PARENT_CONTAINER_ID  Column6 , Container1.POSITION_DIMENSION_ONE  Column7 , Container1.POSITION_DIMENSION_TWO  Column8 \nFROM  CATISSUE_SITE Site1 , CATISSUE_STORAGE_CONTAINER StorageContainer1 , CATISSUE_CONTAINER Container1  \nWHERE Site1.IDENTIFIER   =  StorageContainer1.SITE_ID  AND Container1.IDENTIFIER   =  StorageContainer1.IDENTIFIER    AND ( ( StorageContainer1.IDENTIFIER  IS NOT NULL  )   AND UPPER(Site1.ACTIVITY_STATUS ) != UPPER(\'Disabled\')   AND UPPER(Container1.ACTIVITY_STATUS ) != UPPER(\'Disabled\')   AND UPPER(Container1.ACTIVITY_STATUS ) != UPPER(\'Disabled\')  )\nORDER BY Site1.IDENTIFIER ,StorageContainer1.IDENTIFIER ,Container1.IDENTIFIER ',13),(4,'Select ContainerType1.NAME  Column0 , SpecimenArrayType1.IDENTIFIER  Column1 , SpecimenArrayType1.SPECIMEN_CLASS  Column2 , ContainerType1.ONE_DIMENSION_LABEL  Column3 , ContainerType1.TWO_DIMENSION_LABEL  Column4 \nFROM  CATISSUE_SPECIMEN_ARRAY_TYPE SpecimenArrayType1 , CATISSUE_CONTAINER_TYPE ContainerType1  \nWHERE SpecimenArrayType1.IDENTIFIER   =  ContainerType1.IDENTIFIER    AND ( ( SpecimenArrayType1.IDENTIFIER  IS NOT NULL  )   AND UPPER(ContainerType1.ACTIVITY_STATUS ) != UPPER(\'Disabled\')   AND UPPER(ContainerType1.ACTIVITY_STATUS ) != UPPER(\'Disabled\')  )\nORDER BY SpecimenArrayType1.IDENTIFIER ,ContainerType1.IDENTIFIER ',14),(5,'Select SpecimenProtocol1.TITLE  Column0 , CollectionProtocol1.IDENTIFIER  Column1 , User1.LAST_NAME  Column2 , User1.FIRST_NAME  Column3 , SpecimenProtocol1.SHORT_TITLE  Column4 , SpecimenProtocol1.IRB_IDENTIFIER  Column5 , SpecimenProtocol1.START_DATE  Column6 \nFROM  CATISSUE_USER User1 , CATISSUE_COLLECTION_PROTOCOL CollectionProtocol1 , CATISSUE_SPECIMEN_PROTOCOL SpecimenProtocol1  \nWHERE User1.IDENTIFIER   =  SpecimenProtocol1.PRINCIPAL_INVESTIGATOR_ID  AND SpecimenProtocol1.IDENTIFIER   =  CollectionProtocol1.IDENTIFIER    AND ( ( CollectionProtocol1.IDENTIFIER  IS NOT NULL  )   AND UPPER(SpecimenProtocol1.ACTIVITY_STATUS ) != UPPER(\'Disabled\')   AND UPPER(User1.ACTIVITY_STATUS ) != UPPER(\'Disabled\')   AND UPPER(SpecimenProtocol1.ACTIVITY_STATUS ) != UPPER(\'Disabled\')  )\nORDER BY CollectionProtocol1.IDENTIFIER ,SpecimenProtocol1.IDENTIFIER ,User1.IDENTIFIER ',16);

